export const inputConfig = [
  {
    key: "0",
    fieldDecorator: {
      name: "username",
      type: "email",
      message: "Enter your email",
    },
    prefix: {
      iconType: "user",
      type: "",
      placeholder: "Email",
    },
  },
  {
    key: "1",
    fieldDecorator: {
      name: "password",
      type: "",
      message: "Please input your Password",
    },
    prefix: {
      iconType: "lock",
      type: "password",
      placeholder: "Enter your password",
    },
  },
];
